import React, {Component} from 'react';


class Table extends Component {;
    render() {
        //console.log("table组件更新搜索词",this.props.filterText)
        let studiesFiltered = this.props.studies;
        if (this.props.filterText !== '') {
            //使用正则表达式匹配
            studiesFiltered = this.props.studies.filter((study) => {
                return -1 !== study.patient["patient_name"].search(this.props.filterText);
            });
        }
        return (
            <table>
                <thead>
                    <th>Patient Name</th>
                    <th>Study ID</th>
                    <th>Study Date</th>
                    <th>Study Description</th>
                    <th>Modality</th>
                    <th>Images Count</th>
                </thead>
                <tbody>
                    {studiesFiltered.map(study => {
                        return (

                        <tr> 
                            <td>{study.patient["patient_name"]}</td>
                            <td>{study.study_instance_uid}</td>
                            <td></td>
                            <td>{study.study_description}</td>
                            <td>{study.modalities[0]}</td>
                            <td>{study.images_count}</td>
                        </tr>
                        )
                    })}
                </tbody>
            </table>
        )
    }
}
export default Table;
